import React from "react";
import { useDispatch, useSelector } from "react-redux";
import "./styles/style.css";

const About = () => {
  let about = useSelector((state) => state.fetchAbout);

  return (
    <div className="about">
      <div>{about.about}</div>
    </div>
  );
};

export default About;
